function setupNavBar(){const t=Array.prototype.slice.call(document.querySelectorAll(".navbar-burger"),0);t.length>0&&t.forEach(t=>{t.addEventListener("click",()=>{const e=t.dataset.target,a=document.getElementById(e);t.classList.toggle("is-active"),a.classList.toggle("is-active")})})}function setDataLinks(){document.querySelectorAll("[data-link]").forEach(t=>{t.addEventListener("click",()=>{document.location=t.dataset.link})})}document.addEventListener("DOMContentLoaded",()=>{setupNavBar(),setDataLinks()});